    string memory petals = '$1<path id="g-petal" fill="#EACCF9" d="M1,-69c-1.8-6.2-7.9-9.9-7.9-9.9s-3.4,6.4-1.8,12.5c1.7,6.2,7.9,9.8,7.9,9.8S2.5,-62.6z"/>';
