    '<path fill="none" stroke="#9cb026" stroke-linecap="round" stroke-width="3" d="M-0.2 -138c-.2.3-3.4 7-3.7 22.2s14.2 58-1.1 115"/> <path fill="none" stroke="#9cb026" stroke-width="2" d="M0.7 -84.6s13.6-14.9 27.8-18.5" />';

